import { FC } from 'react';
import { View } from 'react-native';
import {
	MessagesContainer,
	MessagesContents,
	MessageContainer,
	MessageContent,
	PersonIcon,
	MessageTickContainer,
	MessageTick,
	MessageFooter,
	MessageText,
	Title,
	Deleted,
	Content,
} from './style';
import Typography from '../Typography';

interface MessageParams {
	isDeleted?: boolean;
	notifications: Notification;
}

interface Message2Params {
	isDeleted?: boolean;
	text: string;
	title: string;
	time: string;
	index: number;
}

const Message2: FC<Message2Params> = ({
	isDeleted,
	text,
	title,
	time,
	index,
}) => {
	return (
		<MessageContainer key={text}>
			{index === 0 && (
				<MessageTickContainer>
					<MessageTick />
				</MessageTickContainer>
			)}
			<MessageContent index={index}>
				{(isDeleted || index === 0) && (
					<Title>
						{index === 0 ? (
							<Typography type="h4">{title}</Typography>
						) : (
							<View />
						)}
						{isDeleted && (
							<Deleted>
								<Typography type="subtitle2" color="red">
									Deleted
								</Typography>
							</Deleted>
						)}
					</Title>
				)}
				<Content>
					<MessageText>
						<Typography>{text}</Typography>
					</MessageText>
					<MessageFooter>
						<Typography type="caption">{time}</Typography>
					</MessageFooter>
				</Content>
			</MessageContent>
		</MessageContainer>
	);
};

